import React from 'react';
import { Form, Button, Card, Row, Col } from 'react-bootstrap';
import QueryForm from './QueryForm';

const TableForm = ({ table, index, formData, setFormData }) => {
  const loadTypes = ['FULL', 'INCREMENTAL'];
  const writeModes = ['APPEND', 'OVERWRITE', 'MERGE', 'PARTITION_OVERWRITE'];
  const viewTypes = ['standalone', 'materialized'];

  const handleTableNameChange = (e) => {
    const newTables = [...formData.ReportName.tables];
    newTables[index] = {
      ...newTables[index],
      tablename: e.target.value
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleLoadTypeChange = (e) => {
    const newTables = [...formData.ReportName.tables];
    newTables[index] = {
      ...newTables[index],
      LoadType: e.target.value
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleWriteModeChange = (e) => {
    const newTables = [...formData.ReportName.tables];
    newTables[index] = {
      ...newTables[index],
      WriteMode: e.target.value
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleIsViewChange = (e) => {
    const newTables = [...formData.ReportName.tables];
    newTables[index] = {
      ...newTables[index],
      IsView: e.target.value
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleViewTypeChange = (e) => {
    const newTables = [...formData.ReportName.tables];
    newTables[index] = {
      ...newTables[index],
      View_Type: e.target.value
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleAddQuery = () => {
    const newTables = [...formData.ReportName.tables];
    newTables[index] = {
      ...newTables[index],
      query: [
        ...newTables[index].query,
        {
          queryType: 'SQL',
          QueryName: '',
          QueryOrder: '',
          QueryFileName: '',
          queryParameter: {}
        }
      ]
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleRemoveTable = () => {
    const newTables = formData.ReportName.tables.filter((_, i) => i !== index);
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  return (
    <Card className="mb-3">
      <Card.Body>
        <Row className="mb-3">
          <Col>
            <Form.Group>
              <Form.Label>Table Name</Form.Label>
              <Form.Control
                type="text"
                value={table.tablename}
                onChange={handleTableNameChange}
                required
              />
            </Form.Group>
          </Col>
          <Col>
            <Form.Group>
              <Form.Label>Load Type</Form.Label>
              <Form.Select
                value={table.LoadType}
                onChange={handleLoadTypeChange}
                required
              >
                {loadTypes.map(type => (
                  <option key={type} value={type}>{type}</option>
                ))}
              </Form.Select>
            </Form.Group>
          </Col>
          <Col>
            <Form.Group>
              <Form.Label>Write Mode</Form.Label>
              <Form.Select
                value={table.WriteMode}
                onChange={handleWriteModeChange}
                required
              >
                {writeModes.map(mode => (
                  <option key={mode} value={mode}>{mode}</option>
                ))}
              </Form.Select>
            </Form.Group>
          </Col>
        </Row>

        <Row className="mb-3">
          <Col>
            <Form.Group>
              <Form.Label>Is View</Form.Label>
              <Form.Select
                value={table.IsView}
                onChange={handleIsViewChange}
                required
              >
                <option value="0">No</option>
                <option value="1">Yes</option>
              </Form.Select>
            </Form.Group>
          </Col>
          <Col>
            <Form.Group>
              <Form.Label>View Type</Form.Label>
              <Form.Select
                value={table.View_Type}
                onChange={handleViewTypeChange}
                required
              >
                {viewTypes.map(type => (
                  <option key={type} value={type}>{type}</option>
                ))}
              </Form.Select>
            </Form.Group>
          </Col>
        </Row>

        <div className="mb-3">
          <h5>Queries</h5>
          {table.query.map((query, queryIndex) => (
            <QueryForm
              key={queryIndex}
              query={query}
              tableIndex={index}
              queryIndex={queryIndex}
              formData={formData}
              setFormData={setFormData}
            />
          ))}
          <Button variant="secondary" onClick={handleAddQuery} className="mt-2">
            Add Query
          </Button>
        </div>

        <Button
          variant="danger"
          onClick={handleRemoveTable}
          className="mt-2"
        >
          Remove Table
        </Button>
      </Card.Body>
    </Card>
  );
};

export default TableForm;
